A typical chain of Orbit might be instantiated as follows: fn tls_server_blueprints() -> Result<Blueprints<1, Orbits>, ConfigurationError> { let tls_config_server = TlsServerConfig::with_certs_and_key_file(Path::new(CA), Path::new(CERT), Path::new(KEY)) .unwrap(); let server_context = blueprint_tls::TlsContext::Server(TlsServer::with_config(tls_config_server).unwrap()); BlueprintsLayers::<1>::layers([Orbits::Tls(server_context)]) .app(Orbits::H11Server(H11SpecServer::with_defaults().unwrap()))
} Which is typically then provided into the runtime upon instantiation of new clients e.g. in yaoi [upon TCP accept] // uncomment for cleartext only pipeline
// let mut bp_listener: [Blueprints::<1, Orbits>; 2] = core::array::from_fn(|_| tls_server_blueprints());
let mut bp_listener: [Blueprints::<0, Orbits>; 2] = core::array::from_fn(|_| clear_server_blueprints()); // Setup Listener behaviour on_accept
listener .accept_with_cb(&mut bp_listener, |ud, stream| { let id = stream.fixed_fd().unwrap() as usize; stream.run_blueprints(&mut ud[id-1]).unwrap(); }) .unwrap();
